import {
  Component,
  OnInit,
  HostBinding,
  Input,
  AfterContentInit
} from "@angular/core";
import { css } from "emotion";

@Component({
  selector: "a-setting-icon",
  template: `
    <svg width="24" height="24" viewBox="0 0 24 24">
      <path fill="transparent" d="M0 0h24v24H0V0z" />
      <path
        fill="#184da8"
        d="M19 19H5V5h7V3H5c-1.11
  0-2 .9-2 2v14c0 1.1.89 2 2
  2h14c1.1 0 2-.9 2-2v-7h-2v7zM14
  3v2h3.59l-9.83 9.83 1.41 1.41L19
  6.41V10h2V3h-7z"
      />
    </svg>
  `
})
export class SettingIconComponent implements OnInit, AfterContentInit {
  @HostBinding("class") className;
  @Input() customStyle: string;

  constructor() {}

  ngOnInit() {
    const { customStyle } = this;
    this.className = css([
      {
        "& svg": {
          fill: "#184da8"
        }
      },
      `${customStyle}`
    ]);
  }

  ngAfterContentInit() {}
}

